import{_ as e,c as a,o as l,ab as t}from"./chunks/framework.CUflZczI.js";const u=JSON.parse('{"title":"Експериментальні автопілоти з підтримкою користувачів","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/autopilot_experimental.md","filePath":"uk/flight_controller/autopilot_experimental.md"}'),i={name:"uk/flight_controller/autopilot_experimental.md"},r=t('<h1 id="експериментальні-автопілоти-з-підтримкою-користувачів" tabindex="-1">Експериментальні автопілоти з підтримкою користувачів <a class="header-anchor" href="#експериментальні-автопілоти-з-підтримкою-користувачів" aria-label="Permalink to &quot;Експериментальні автопілоти з підтримкою користувачів&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Для отримання додаткової інформації про рівні підтримки плат автопілотів проекту PX4 дивіться: <a href="https://px4.io/autopilots/" target="_blank" rel="noreferrer">px4.io/autopilots/</a>.</p></div><h2 id="експериментальні-автопілоти" tabindex="-1">Експериментальні автопілоти <a class="header-anchor" href="#експериментальні-автопілоти" aria-label="Permalink to &quot;Експериментальні автопілоти&quot;">​</a></h2><p>Ця категорія призначена для експериментальних автопілотів (і &quot;платформ&quot; автопілотів), які <em>не підтримуються</em> ні командою проекту PX4, ні виробником.</p><ul><li><a href="./../flight_controller/beaglebone_blue.html">BeagleBone Blue</a></li><li><a href="./../flight_controller/raspberry_pi_navio2.html">Raspberry Pi 2/3 Navio2</a></li><li><a href="./../flight_controller/raspberry_pi_pilotpi.html">Raspberry Pi 2/3/4 PilotPi Shield</a></li></ul><p>Плати цієї категорії повинні працювати принаймні з одним релізом PX4 для певного типу апарату. Вони можуть бути несумісними з поточним випуском PX4, і проект не підтримує сумісність для майбутніх випусків.</p><h2 id="експериментальні-апарати" tabindex="-1">Експериментальні апарати <a class="header-anchor" href="#експериментальні-апарати" aria-label="Permalink to &quot;Експериментальні апарати&quot;">​</a></h2><p>Це <a href="./../complete_vehicles_mc/">готові апарати</a>, які мають повністю інтегрований автопілот та інше обладнання (тобто, на відміну від інших перелічених автопілотів, ви не можете використовувати їх у власних збірках). Вони перераховані на цій сторінці, тому що з точки зору програмного забезпечення PX4 вони є ще одним автопілотом.</p><ul><li><a href="./../complete_vehicles_mc/crazyflie2.html">Bitcraze Crazyflie 2.0</a> (<a href="./../complete_vehicles_mc/">Complete Vehicle</a>)</li><li><a href="./../complete_vehicles_mc/crazyflie21.html">Bitcraze Crazyflie 2.1</a> (<a href="./../complete_vehicles_mc/">Complete Vehicle</a>)</li></ul>',9),o=[r];function c(_,h,p,s,n,m){return l(),a("div",null,o)}const d=e(i,[["render",c]]);export{u as __pageData,d as default};
